class JsonToEventDataACProcessorTests(TestCase):
    def test_assert_types_of_result_method_processJson(self):
        processor = JsonToEventDataACProcessor()
        listEventDataAC = processor.processJson(JsonTestData.jsonLines)
        self.assertGreater(len(listEventDataAC), 0)
        self.assertTrue(isinstance(listEventDataAC[0], EventDataAC))

    def test_assert_processJson_results_in_EventDataAC_ident8_values(self):
        processor = JsonToEventDataACProcessor()
        listEventDataAC = processor.processJson(JsonTestData.jsonLines)
        self.assertEqual("A0040002", listEventDataAC[0].ident8)
        self.assertEqual("N0180001", listEventDataAC[1].ident8)

    def test_assert_processJson_results_in_EventDataAC_ident8_values_problem_in_jsonObject(self):
        processor = JsonToEventDataACProcessor()
        listEventDataAC = processor.processJson(JsonTestData.problemJsonObject)
        self.assertEqual("N0740002", listEventDataAC[0].ident8)


    def test_assert_processJson_results_in_EventDataAC_wkt_values(self):
        processor = JsonToEventDataACProcessor()
        listEventDataAC = processor.processJson(JsonTestData.jsonLines)
        self.assertEqual(
            "LINESTRING ZM (161468.378768416 160252.040726318 0 12.054, 161473.488399997 160248.7412 0 12.0601500000048, 161485.656400003 160239.505199999 0 12.0755499999941, 161497.47762291 160231.46343517 0 12.09)",
            listEventDataAC[0].wktLineStringZM)
        self.assertEqual(
            "LINESTRING ZM (204687.014412866 207284.945373632 0 23.331, 204687.998785856 207284.800409002 0 23.332)",
            listEventDataAC[1].wktLineStringZM)

    def test_assert_FSInputToWktLineStringZM_returns_valid_LinestringZM(self):
        processor = JsonToEventDataACProcessor()
        result = processor.FSInputToWktLineStringZM(
            [[161468.378768416, 160252.040726318, 0, 12.054], [161473.488399997, 160248.7412, 0, 12.0601500000048],
             [161485.656400003, 160239.505199999, 0, 12.0755499999941], [161497.47762291, 160231.46343517, 0, 12.09]])
        expected = "LINESTRING ZM (161468.378768416 160252.040726318 0 12.054, 161473.488399997 160248.7412 0 12.0601500000048, 161485.656400003 160239.505199999 0 12.0755499999941, 161497.47762291 160231.46343517 0 12.09)"
        self.assertEqual(expected, result)

    def test_assert_processJson_results_in_EventDataAC_begin_values(self):
        processor = JsonToEventDataACProcessor()
        listEventDataAC = processor.processJson(JsonTestData.jsonLines)
        self.assertTrue(isinstance(listEventDataAC[0].begin, WegLocatieData))
        self.assertEqual(12.054, listEventDataAC[0].begin.positie)
        self.assertEqual('gps', listEventDataAC[0].begin.bron)
        self.assertEqual('POINT (161466.73643835858 160249.5952780808)', listEventDataAC[0].begin.wktPoint)

    def test_assert_processJson_results_in_EventDataAC_eind_values(self):
        processor = JsonToEventDataACProcessor()
        listEventDataAC = processor.processJson(JsonTestData.jsonLines)
        self.assertTrue(isinstance(listEventDataAC[0].eind, WegLocatieData))
        print (listEventDataAC[0].eind.positie)
        self.assertEqual(12.09, listEventDataAC[0].eind.positie)
        self.assertEqual('gps', listEventDataAC[0].eind.bron)
        self.assertEqual('POINT (161496.99027397216 160230.19308630042)', listEventDataAC[0].eind.wktPoint)
        print (listEventDataAC[0].eind)

    def test_assert_FSInputToWktPoint_returns_valid_Point(self):
        processor = JsonToEventDataACProcessor()
        result = processor.FSInputToWktPoint([151938.95276640623, 177948.05493700944])
        expected = "POINT (151938.95276640623 177948.05493700944)"
        self.assertEqual(expected, result)

